    value: RESPONSE TO YOUR LETTER OF MARCH 16 2005  Item 1--Schedule A supporting
      Line(s) 11(c).  this activity represents a transfer of funds and we have added
      the word transfer on  Schedule A supporting Line 11(c).       Item 2A--Schedule
      B supporting Line 30(b).  Regarding the direct mail processing.  These two transactions
      were on behalf of non-federal candidates and made no mention of any federal
      candidates.  These two transactions have been moved to Line 29.  Item 2B--Schedule
      B supporting Line 30(b).  Regarding the newspaper ad slate card info.  Please
      note that payment for the newspaper ad slate card info was for a newspaper ad
      in which 25% of the total at $50.00 a piece was for 2 federal candidates and
      that portion was moved to Schedule E Line 24.   This is the balance of a $400
      expenditure $100.00 of which is on Schedule E.   Item 3--The independent expenditure
      schedule (Schedule E) has been amended and now provides the election designation.    Item
      4--Schedule E and Schedule F--We hereby confirm that all payments reported on
